import React from 'react'
import { Modal } from 'antd';

export default function ReportsDoctors({ id_medico, isModalOpen, handleOk }) {
    return (
        <Modal title="Basic Modal" open={isModalOpen} onOk={handleOk} onCancel={handleOk}>
            <p>{id_medico}</p>
            <p>Some contents...</p>
            <p>Some contents...</p>
        </Modal>
    )
}
